import React from 'react';
import IButton from './components/IButton';

function app () {
  const handleClick = () => {
    console.log('Botón clickeado');
  };

  return (
    <div>
      <IButton text="Button Custom" onClick={handleClick} />
    </div>
  );

};

export default App;
